import React from 'react';
import './App.css';
import Header from "./components/Header/Header";
import Navbar from "./components/Navbar/Navbar";
import Profile from "./components/Profile/Profile";
import Dialogs from "./components/Dialogs/Dialogs";
import {BrowserRouter, Route} from "react-router-dom";
// import {addPost} from "./redux/state";
// import {updateNewTekstPost} from "./redux/state";



function App(props) {

    return (
        <BrowserRouter>

            <div className='app-wrapper'>
                <Header/>
                <Navbar navLinks={props.state.navLink}/>
                <div className='app-wrapper-content'>

                        <Route path='/profile' render={() => <Profile   posts={props.state.profilePage.postInfo} newPostText={props.state.profilePage.newPostText} dispatch={props.dispatch} />} />
                        <Route path='/dialogs' render={() => <Dialogs message={props.state.messagePage.messagesList} dialogs={props.state.messagePage.names} textMessage={props.state.messagePage.textMessage} dispatch={props.dispatch}/>}/>

                </div>
            </div>
        </BrowserRouter>
    );
}

export default App;
